using Bogus;
using Bogus.Extensions.UnitedKingdom;
using Microsoft.AspNetCore.Identity;
using Microsoft.EntityFrameworkCore;
using SophieHR.Api.Models;

namespace SophieHR.Api.Data
{
    public class DataSeeder
    {
        public static async Task Initialize(IServiceProvider serviceProvider)
        {
            using (var context = new ApplicationDbContext(serviceProvider.GetRequiredService<DbContextOptions<ApplicationDbContext>>()))
            {
                var _roleManager = serviceProvider.GetRequiredService<RoleManager<IdentityRole<Guid>>>();
                var _userManager = serviceProvider.GetRequiredService<UserManager<ApplicationUser>>();
                var _logger = serviceProvider.GetRequiredService<ILogger<DataSeeder>>();
                await SeedDBAsync(context, _roleManager, _userManager, _logger);
            }
        }

        public static async Task SeedDBAsync(ApplicationDbContext context, RoleManager<IdentityRole<Guid>> _roleManager, UserManager<ApplicationUser> _userManager, ILogger<DataSeeder> _logger)
        {
            if (!context.Companies.Any())
            {
                // Create some companies and logos:
                _logger.LogInformation("Creating some companies");
                var logo1 = Convert.FromBase64String("");
                var logo2 = Convert.FromBase64String("");
                var logo3 = Convert.FromBase64String("");
                var logo4 = Convert.FromBase64String("");
                var logo5 = Convert.FromBase64String("");

                var logos = new List<byte[]> { logo1, logo2, logo3, logo4, logo5 };

                var addressFaker = new Faker<CompanyAddress>("en_GB")
                    .RuleFor(x => x.Line1, f => f.Address.BuildingNumber())
                    .RuleFor(x => x.Line2, f => f.Address.StreetAddress())
                    .RuleFor(x => x.Line3, f => f.Address.SecondaryAddress())
                    .RuleFor(x => x.County, f => f.Address.County())
                    .RuleFor(x => x.Postcode, f => f.Address.ZipCode());

                var companyFaker = new Faker<Company>("en_GB")
                    .RuleFor(x => x.Address, f => addressFaker.Generate(1).First())
                    .RuleFor(x => x.Logo, f => f.PickRandom(logos))
                    .RuleFor(x => x.Name, f => f.Company.CompanyName())
                    .RuleFor(x => x.CreatedDate, f => f.Date.Past());

                var companies = companyFaker.Generate(15);
                await context.Companies.AddRangeAsync(companies);


                var departmentFaker = new Faker<Department>("en_GB")
                    .RuleFor(x => x.Name, f => f.Name.JobArea())
                    .RuleFor(x => x.Company, f => f.PickRandom(companies));

                var departments = departmentFaker.Generate(5);
                await context.Departments.AddRangeAsync(departments);

                await context.SaveChangesAsync();
            }

            // Add some departments
            _logger.LogInformation("Creating some departments for the companies");
            var company1 = context.Companies.AsNoTrackingWithIdentityResolution().OrderBy(x => x.Id).First();
            var company2 = context.Companies.AsNoTrackingWithIdentityResolution().OrderBy(x => x.Id).Skip(1).First();
            await context.Departments.AddRangeAsync(
                new Department
                {
                    CompanyId = company1.Id,
                    Name = "Sales"
                }, new Department
                {
                    CompanyId = company1.Id,
                    Name = "IT"
                }, new Department
                {
                    CompanyId = company2.Id,
                    Name = "Marketing"
                }, new Department
                {
                    CompanyId = company2.Id,
                    Name = "IT"
                }
                );
            await context.SaveChangesAsync();


            if (!context.Roles.Any())
            {
                _logger.LogInformation("Creating some roles");
                await _roleManager.CreateAsync(new IdentityRole<Guid> { Name = "Admin" });
                await _roleManager.CreateAsync(new IdentityRole<Guid> { Name = "Manager" });
                await _roleManager.CreateAsync(new IdentityRole<Guid> { Name = "User" });
            }

            if (!context.Users.Any())
            {
                _logger.LogInformation("Creating some admin users");
                var adminUser = new ApplicationUser
                {
                    UserName = "admin@hr.com",
                    Email = "admin@hr.com",
                    FirstName = "Marcus",
                    LastName = "Stockton"
                };
                await _userManager.CreateAsync(adminUser, "P@55w0rd1");
                await _userManager.AddToRoleAsync(adminUser, "Admin");
            }

            if (!context.Employees.Any())
            {
                _logger.LogInformation("Creating some employees");

                var company1deptSales = context.Departments.Where(x => x.CompanyId == company1.Id && x.Name == "Sales").First();
                var company1deptIT = context.Departments.Where(x => x.CompanyId == company1.Id && x.Name == "IT").First();
                var company2deptMarketing = context.Departments.Where(x => x.CompanyId == company2.Id && x.Name == "Marketing").First();
                var company2deptIT = context.Departments.Where(x => x.CompanyId == company2.Id && x.Name == "IT").First();

                var emp1Image = Convert.FromBase64String("");
                var emp2Image = Convert.FromBase64String("");
                var emp3Image = Convert.FromBase64String("");
                var emp4Image = Convert.FromBase64String("");
                var emp5Image = Convert.FromBase64String("");
                var emp6Image = Convert.FromBase64String("");
                var emp7Image = Convert.FromBase64String("");
                var emp8Image = Convert.FromBase64String("");
                var emp9Image = Convert.FromBase64String("");
                var emp10Image = Convert.FromBase64String("");
                var emp11Image = Convert.FromBase64String("");
                var emp12Image = Convert.FromBase64String("");

                var demoImages = new List<byte[]> { emp1Image, emp2Image, emp3Image, emp4Image, emp5Image, emp6Image, emp7Image, emp8Image, emp9Image, emp10Image, emp11Image, emp12Image };

                // Add some employees
                List<Employee> comp1deptITEmployeeManagers = await CreateManagers(context, _logger, company1, company1deptIT, demoImages);
                List<Employee> comp1deptITEmployeeUsers = await CreateUsers(context, _logger, company1, company1deptIT, demoImages, comp1deptITEmployeeManagers);

                List<Employee> comp1deptSalesEmployeeManagers = await CreateManagers(context, _logger, company1, company1deptSales, demoImages);
                List<Employee> comp1deptSalesEmployeeUsers = await CreateUsers(context, _logger, company1, company1deptSales, demoImages, comp1deptSalesEmployeeManagers);

                try
                {
                    await context.SaveChangesAsync();

                    foreach (var user in comp1deptITEmployeeManagers)
                    {
                        await _userManager.AddPasswordAsync(user, "P@55w0rd1");
                        await _userManager.AddToRoleAsync(user, "Manager");
                    }
                    foreach (var user in comp1deptITEmployeeUsers)
                    {
                        await _userManager.AddPasswordAsync(user, "P@55w0rd1");
                        await _userManager.AddToRoleAsync(user, "User");
                    }

                    foreach (var user in comp1deptSalesEmployeeManagers)
                    {
                        await _userManager.AddPasswordAsync(user, "P@55w0rd1");
                        await _userManager.AddToRoleAsync(user, "Manager");
                    }
                    foreach (var user in comp1deptSalesEmployeeUsers)
                    {
                        await _userManager.AddPasswordAsync(user, "P@55w0rd1");
                        await _userManager.AddToRoleAsync(user, "User");
                    }
                }
                catch (Exception ex)
                {
                    Console.WriteLine(ex);
                    throw;
                }
            }
        }

        private static async Task<List<Employee>> CreateUsers(ApplicationDbContext context, ILogger<DataSeeder> _logger, Company company1, Department company1deptIT, List<byte[]> demoImages, List<Employee> comp1deptITEmployeeManagers)
        {
            var Company1deptITEmployees = new Faker<Employee>("en_GB")
                .RuleFor(bp => bp.Gender, f => f.PickRandom<Gender>())
                .RuleFor(bp => bp.Title, f => f.PickRandom<Title>())
                .RuleFor(bp => bp.FirstName, (f, u) => f.Name.FirstName((Bogus.DataSets.Name.Gender)u.Gender))
                .RuleFor(bp => bp.LastName, (f, u) => f.Name.LastName((Bogus.DataSets.Name.Gender)u.Gender))
                .RuleFor(bp => bp.CompanyId, f => company1.Id)
                .RuleFor(bp => bp.StartOfEmployment, (f, u) => f.Date.Recent(4600))
                .RuleFor(bp => bp.DepartmentId, f => company1deptIT.Id)
                .RuleFor(bp => bp.NationalInsuranceNumber, f => f.Finance.Nino().Replace(" ", ""))
                .RuleFor(bp => bp.PassportNumber, f => DateTime.UtcNow.Ticks.ToString().Substring(9))
                .RuleFor(bp => bp.Address, f => new EmployeeAddress
                {
                    County = f.Address.County(),
                    Line1 = f.Address.BuildingNumber() + " " + f.Address.StreetName(),
                    Line2 = f.Address.SecondaryAddress(),
                    Line3 = f.Address.StreetSuffix(),
                    Postcode = f.Address.ZipCode()
                })
                .RuleFor(bp => bp.DateOfBirth, f => f.Person.DateOfBirth)
                .RuleFor(bp => bp.WorkEmailAddress, (f, u) => f.Internet.Email(u.FirstName, u.LastName))
                .RuleFor(bp => bp.UserName, (f, u) => f.Internet.Email(u.FirstName, u.LastName))
                .RuleFor(bp => bp.Email, (f, u) => f.Internet.Email(u.FirstName, u.LastName))
                .RuleFor(bp => bp.JobTitle, f => f.Name.JobTitle())
                .RuleFor(bp => bp.Avatar, f => new EmployeeAvatar { Avatar = f.PickRandom(demoImages) })
                .RuleFor(bp => bp.Manager, f => f.PickRandom(comp1deptITEmployeeManagers))
                .RuleFor(bp => bp.HolidayAllowance, f => f.Random.Number(28, 50))
                .RuleFor(bp => bp.PhoneNumber, f => f.Phone.PhoneNumber())
                .FinishWith((f, bp) => _logger.LogInformation($"Employee created for company {company1.Name} and department {company1deptIT.Name}. Id={bp.Id}"));

            var num = Faker.RandomNumber.Next(8, 20);
            var users = Company1deptITEmployees.Generate(num);
            await context.Employees.AddRangeAsync(users);
            return users;
        }

        private static async Task<List<Employee>> CreateManagers(ApplicationDbContext context, ILogger<DataSeeder> _logger, Company company1, Department company1deptIT, List<byte[]> demoImages)
        {
            var Company1deptITManagers = new Faker<Employee>("en_GB")
                .RuleFor(bp => bp.Gender, f => f.PickRandom<Gender>())
                .RuleFor(bp => bp.Title, f => f.PickRandom<Title>())
                .RuleFor(bp => bp.FirstName, (f, u) => f.Name.FirstName((Bogus.DataSets.Name.Gender)u.Gender))
                .RuleFor(bp => bp.LastName, (f, u) => f.Name.LastName((Bogus.DataSets.Name.Gender)u.Gender))
                .RuleFor(bp => bp.NationalInsuranceNumber, f => f.Finance.Nino().Replace(" ", ""))
                .RuleFor(bp => bp.PassportNumber, f => DateTime.UtcNow.Ticks.ToString().Substring(9))
                .RuleFor(bp => bp.CompanyId, f => company1.Id)
                .RuleFor(bp => bp.StartOfEmployment, (f, u) => f.Date.Recent(4600))
                .RuleFor(bp => bp.DepartmentId, f => company1deptIT.Id)
                .RuleFor(bp => bp.Address, f => new EmployeeAddress
                {
                    County = f.Address.County(),
                    Line1 = f.Address.BuildingNumber() + " " + f.Address.StreetName(),
                    Line2 = f.Address.SecondaryAddress(),
                    Line3 = f.Address.StreetSuffix(),
                    Postcode = f.Address.ZipCode()
                })
                .RuleFor(bp => bp.DateOfBirth, f => f.Person.DateOfBirth)
                .RuleFor(bp => bp.WorkEmailAddress, (f, u) => f.Internet.Email(u.FirstName, u.LastName))
                .RuleFor(bp => bp.UserName, (f, u) => f.Internet.Email(u.FirstName, u.LastName))
                .RuleFor(bp => bp.Email, (f, u) => f.Internet.Email(u.FirstName, u.LastName))
                .RuleFor(bp => bp.JobTitle, f => f.Name.JobTitle() + " Manager")
                .RuleFor(bp => bp.HolidayAllowance, f => f.Random.Number(28, 50))
                .RuleFor(bp => bp.PhoneNumber, f => f.Phone.PhoneNumber())
                .RuleFor(bp => bp.Avatar, f => new EmployeeAvatar { Avatar = f.PickRandom(demoImages) })
                .FinishWith((f, bp) => _logger.LogInformation($"Manager created for company {company1.Name} and department {company1deptIT.Name}. Id={bp.Id}"));

            var comp1deptITEmployeeManagers = Company1deptITManagers.Generate(2);
            await context.Employees.AddRangeAsync(comp1deptITEmployeeManagers);
            return comp1deptITEmployeeManagers;
        }
    }
}